import $api from "./index";
import axios from "axios"

export const pochtaTest = async () => {
  const myHeaders = new Headers();
  myHeaders.append("Content-Type", "application/json");
  myHeaders.append(
    "Cookie",
    "PHPSESSID=qsa0vpf9toeimaft8n1q57nvrb; YIICSRFTOKEN=e72bb4877501697b07f858ca08cf0f7d1300ef33s%3A88%3A%22anFwbUs4VHVEUURTQjRpcW5aRjJoS3R1RmpxQlE2X0RZJKSxlLXYTEbVS3e863q_1-PcwfTOYVelljgIS57vZA%3D%3D%22%3B"
  );

  const raw = JSON.stringify({
    apiKey: "a8ce1029e7856b8a14e6b172318a0f31",
    modelName: "Address",
    calledMethod: "getSettlementAreas",
    methodProperties: {
      Ref: "",
    },
  });

  const requestOptions = {
    method: "GET",
    headers: myHeaders,
    body: raw,
    redirect: "follow",
  };

  fetch(
    "https://api.novaposhta.ua/v2.0/json/a8ce1029e7856b8a14e6b172318a0f31",
    requestOptions
  )
    .then((response) => response.text())
    .then((result) => console.log(result))
    .catch((error) => console.error(error));
};
